--
-- Структура таблицы `cbav_hud_snapshots`
--

CREATE TABLE `cbav_hud_snapshots` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `received_at` timestamp NULL DEFAULT current_timestamp(),
  `id_tag` varchar(64) DEFAULT NULL,
  `symbol` varchar(32) DEFAULT NULL,
  `tf` varchar(16) DEFAULT NULL,
  `ver` varchar(16) DEFAULT NULL,
  `ts` bigint(20) DEFAULT NULL,
  `price` decimal(20,8) DEFAULT NULL,
  `features` longtext DEFAULT NULL,
  `levels` longtext DEFAULT NULL,
  `patterns` longtext DEFAULT NULL,
  `raw` longtext DEFAULT NULL,
  `tv_secret_ok` tinyint(1) NOT NULL DEFAULT 0,
  `source_ip` varbinary(16) DEFAULT NULL,
  `user_agent` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;

